const Footer_Journal = () => {
  const benefits = ["تخفیف ها", "رویداد ها", "بروزرسانی ها"];

  return (
    <div className="absolute left-0 right-0 md:w-[50vw] w-[70vw] card size-auto">
      <div>
        <h4 className="title">عضویت در ماهنامه‌ی امپراتوری</h4>
        <div className="flex mt-3">
          <p>با عضویت ماهنامه، به‌روز شوید:</p>
          <ul className="flex gap-x-2 ms-1">
            {benefits.map((item, index) => {
              return (
                <li key={index} className="flex items-center">
                  <i class="fa-duotone fa-solid fa-circle-check me-1"></i>
                  {item}
                </li>
              );
            })}
          </ul>
        </div>
      </div>
      <form className="flex py-2 gap-x-3 md:min-w-[35vw] min-w-full mac-border rounded-full bg-blue-500 text-blue-50">
        <button type="submit">
          <i className="fas fa-magnifying-glass"></i>
        </button>
        <input
          type="text"
          id="search"
          className="py-0 field bg-transparent w-full text-slate-50"
        />
      </form>
    </div>
  );
};

export default Footer_Journal;
